      if (that.userState === 1) {
        flag = false;
        tips = '由于违反相关法律法规，您已被禁言，如有疑问，可找客服申诉';
      }
      if (!flag) {
        uni.showToast({
          title: tips,
          icon: 'none',
          duration: 3000 });

        return;
      }
      that.Bmob.checkMsg(that.contents).then(function (res) {
        uni.showLoading({
          title: '加载中',
          mask: true });

        var currentUser = that.Bmob.User.current(); // 当前用户
        var objectId = currentUser.objectId; // 当前用户Id
        // Pointer 类型在数据库是一个json数据类型，只需调用Pointer方法创建一个Pointer对象存入到字段中，如下：
        var pointer = that.Bmob.Pointer('_User');
        var poiID = pointer.set(objectId);
        var query = that.Bmob.Query('postList');

        query.set('author', poiID);
        query.set("contents", that.contents);
        query.set("view", 0);
        query.set("likes", 0);
        query.set("comments", 0);
        query.set("images", that.imageList);

        // 关联分类表
        if (that.postClassId) {
          var pointerPostClass = that.Bmob.Pointer('postClass');
          var pPostClassID = pointerPostClass.set(that.postClassId);
          query.set('belongsClass', pPostClassID); // 绑定的帖子分类id
        }
        // 关联地区表
        if (that.localId) {
          var pointerLocal = that.Bmob.Pointer('local');
          var pLocalID = pointerLocal.set(that.localId);
          query.set('belongsLocal', pLocalID); // 绑定的帖子分类id
        }

        query.save().then(function (res) {
          uni.hideLoading();
          that.getTodayPublishPostNum();
          uni.showModal({
            title: '发表成功',
            content: '是否立即前往查看',
            confirmText: '前往查看',
            cancelText: '继续发帖',
            success: function success(res) {
              if (res.confirm) {
                uni.reLaunch({
                  url: '/pages/index/index' });

              } else if (res.cancel) {
                that.contents = ''; // 文本内容
                that.imageList = [];
                that.pickIndex = 0;
              }
            } });

        });
      }).catch(function (err) {
        var tips = '错误类型：' + err.code + '，' + err.error;
        if (err.code === 10007) {
          tips = '输入内容含有敏感词，请文明用语';
        }
        uni.showToast({
          title: tips,
          icon: 'none' });

      });
